import axios from "axios";
import React from 'react';

export default class TitleList extends React.Component {
    state = {
        names: [],
    };

    componentDidMount() {
        axios.get(`http://localhost:5000/articles`)
            .then(res => {
                console.log(res);
                this.setState({ names: res.data });
            })
            .catch(err => {
                console.log(err);
                this.setState(err);
            });
    }

    render() {
        return(
            <ul>
                { this.state.names.map(name => <li key ={name.id}><p>{name.title}</p><p>{name.content}</p></li>) }
            </ul>
        );
    }
}

